import React from "react";

const Sidebar = () => {
  const toolbarItems = ["Home", "about", "contacts", "login", "register"];

  return (
    <div className="sidebar">
      for(let x toolbarItems){<div>{x}</div>}
      <div>Articles</div>
      <div>Movies</div>
      <div>Books</div>
    </div>
  );
};

export default Sidebar;
